import React, {ReactNode} from 'react';

class Hashtag extends React.Component<{text: string}, any> {
    public render(): ReactNode {
        let div = (
            <div key={this.props.text}
                 style={{
                     backgroundColor: 'black',
                     opacity: 0.3,
                     zIndex: 1,
                 }}
                 className={'rounded p-1 pl-2 pr-2 m-1'}
            >
                        <span
                            style={{
                                color: 'white',
                                fontWeight: 'bold',
                            }}
                        >
                            #{this.props.text}
                        </span>
            </div>
        );
        console.log(div);
        return div;
    }
}

export default Hashtag;
